import CategoryList from "../Authorization/Category/CategoryList";

const SideBar = () => {
    return (
        <>
            <div>
                <span className='text-center'>Recommended Topics</span>
                <div className='w-[300px]'>
                    <CategoryList/>
                </div>

            </div>
        </>
    )
}

export default SideBar;
